import { Typography, Box } from '@mui/material';

const OrderList: React.FC = () => {
  return (
    <Box>
      <Typography variant="h4">Orders</Typography>
      <Typography>Order list component - to be implemented</Typography>
    </Box>
  );
};

export default OrderList;
